import johnVideosData from './John.json';
import markVideosData from './Mark.json';

interface libraryModelProps {
  username: sting;
}

const libraryModel = (props: libraryModelProps) => {
  const {username} = this.props;
  const johnVideos = johnVideosData.videos;
  const markVideos = markVideosData.videos;

  if ({username} = "john") {
    return johnVideos;
  } 

  if ({username} = "mark") {
    return markVideos;
  }

}

export default libraryModel;
